function App() {

  return (
    <>
          <a href="/">Home</a>
      <a href="/About">About</a>
      <a href="/ContactUs">Contact Us</a>
      <a href="/Services">Services</a>
      <a href="/Register">Register</a>
      <a href="/LogIn">Log In</a>
      <a href="/Dashboard">Dashboard</a>
      <Home />
    </>

  );
}

export default App;
